// src/pages/HomePage.jsx
import React, { useState, useRef } from "react";
import { Box, Typography, Button, TextField } from "@mui/material";
import axios from "axios";

function HomePage() {
  const [form, setForm] = useState({ name: "", email: "", feedback: "" });
  const [status, setStatus] = useState("SEND");
  const timerRef = useRef(null);

  const handleFeedbackSubmit = async (e) => {
    e.preventDefault();
    if (timerRef.current) clearTimeout(timerRef.current);

    setStatus("Sent!");

    try {
      await axios.post(`${process.env.REACT_APP_SERVER}/feedback/`, { data: form });
      setForm({ name: "", email: "", feedback: "" });
    } catch (err) {
      console.error("Feedback failed", err);
    }

    timerRef.current = setTimeout(() => setStatus("SEND"), 4000);
  };

  return (
    <Box
      sx={{
        minHeight: "100vh",
        p: 4,
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        gap: 6,
        background:
          "linear-gradient(180deg, #0a0215 0%, #08010f 40%, #050008 100%)",
        color: "white",
      }}
    >
      {/* HERO */}
      <Box sx={{ textAlign: "center", mt: 8 }}>
        <Typography variant="h2" sx={{ fontWeight: 900 }}>
          Hangman Neon Arena
        </Typography>
        <Typography sx={{ color: "gray", mt: 1 }}>
          Multiplayer Hangman — Fast, Fun, Futuristic ⚡
        </Typography>

        <Button
          href="/create"
          variant="contained"
          sx={{
            mt: 4,
            px: 4,
            py: 1.5,
            fontSize: "1.2rem",
            background:
              "linear-gradient(90deg, #ec4899, #3b82f6)",
            color: "#080414",
          }}
        >
          Start Game
        </Button>
      </Box>

      {/* HOW TO PLAY */}
      <Box
        sx={{
          maxWidth: 650,
          background: "rgba(255,255,255,0.05)",
          backdropFilter: "blur(10px)",
          borderRadius: 4,
          p: 3,
          mt: 4,
        }}
      >
        <Typography variant="h4" sx={{ mb: 2, fontWeight: 700 }}>
          How to Play
        </Typography>
        <Typography>
          1. Press "Start Game" & create a room. <br />
          2. Share the link with friends. <br />
          3. Each round, someone chooses a word. <br />
          4. Guess letters correctly before lives run out! <br />
        </Typography>
      </Box>

      {/* FEEDBACK */}
      <Box
        sx={{
          maxWidth: 500,
          width: "100%",
          background: "rgba(255,255,255,0.04)",
          p: 3,
          borderRadius: 3,
        }}
      >
        <Typography variant="h5" sx={{ mb: 2 }}>
          Feedback
        </Typography>

        <form onSubmit={handleFeedbackSubmit}>
          <TextField
            label="Name"
            fullWidth
            value={form.name}
            onChange={(e) => setForm({ ...form, name: e.target.value })}
            margin="normal"
            required
          />
          <TextField
            label="Email"
            fullWidth
            type="email"
            value={form.email}
            onChange={(e) => setForm({ ...form, email: e.target.value })}
            margin="normal"
            required
          />
          <TextField
            label="Feedback"
            fullWidth
            multiline
            rows={4}
            value={form.feedback}
            onChange={(e) => setForm({ ...form, feedback: e.target.value })}
            margin="normal"
            required
          />

          <Button type="submit" variant="contained" sx={{ mt: 2 }}>
            {status}
          </Button>
        </form>
      </Box>
    </Box>
  );
}

export default HomePage;
